import React, { useState } from 'react';
import './Home.css';

const HomePage = () => {
  const [email, setEmail] = useState('');

  const handleEmailChange = (e) => {
    setEmail(e.target.value);
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    alert(`Subscribed with email: ${email}`);
  };

  return (
    <div className="homepage">
      <header className="homepage-header">
        <h2 className="title">Welcome to Devs On Deck</h2>

        <div className="search-bar">
          <input type="text" placeholder="Search for jobs or companies..." />
          <button>Search</button>
        </div>
      </header>

      <div className="sections">
        <div className="section">
          <h3>About Us</h3>
          <p>Devs On Deck is a platform designed to bridge the gap between talented developers and organizations. We aim to empower developers by helping them find job opportunities and enabling recruiters to discover skilled professionals.</p>
        </div>

        <div className="section">
          <h3>Our Mission</h3>
          <p>Our mission is to connect developers with meaningful career opportunities while assisting organizations in discovering and recruiting top tech talent. We believe in fostering a collaborative environment where developers can share their skills and grow their careers.</p>
        </div>

        <div className="section">
          <h3>FAQ</h3>
          <p>Find answers to frequently asked questions about our platform, features, and services.</p>
          <form onSubmit={handleSubmit}>
            <label htmlFor="email">Subscribe for Updates</label>
            <input 
              type="email" 
              id="email" 
              value={email} 
              onChange={handleEmailChange} 
              placeholder="Enter your email" 
              required 
            />
            <button type="submit">Subscribe</button>
          </form>
        </div>
      </div>
    </div>
  );
};

export default HomePage;
